    "yinsizhengce" : MessageLookupByLibrary.simpleMessage("保护及尊重用户个人隐私是公司的一项基本政策。我司将严格遵守法律法规的相关规定，采取合理、必要的安全措施，保护用户的个人信息。\n本政策适用于我司提供的全部产品和服务，在使用我司产品或服务前，请您仔细阅读《隐私政策》的全部内容，了解用户信息的收集范围及使用方式，并根据自身的判断决定是否选择我们提供的服务。若用户不同意本政策内容，将可能导致我司的产品无法正常运行或服务无法正常提供。若用户使用我司产品或服务，将视为同意我司按照本政策收集、使用、分享、披露、储存用户的个人信息。\n用户在阅读本政策内容后有任何疑问的，可通过我司对外公布的联系方式联系我们，我司将在收到用户反馈后及时进行解答。\n一、我们收集哪些信息\n为了实现产品功能及为用户提供优质的服务，我司将根据合法必要原则收集及使用用户信息，我司收集的信息内容如下：\n1、用户在使用我司提供的测算服务时，为了保存您的分析报告结果，我们需要获取您的手机号码或邮箱地址、微信号，如拒绝提供这些信息会使您无法使用相关特定功能。\n2、用户在使用产品或服务过程中，我司基于服务提供之需要而主动获取的信息，包括但不限于账号信息、浏览及搜索信息、订阅收藏及下载信息、服务日志信息、设备信息、手机软件信息、日历信息、IP地址、通讯日志、位置信息；\n【日志信息：当用户使用我司商品或服务时，我司可能会自动收集用户对我司服务的详细使用情况作为有关网络日志保存。例如用户搜索查询收藏内容、IP地址、浏览器的类型、电信运营商、使用的语言、访问日期和时间及用户访问的网页浏览记录等】\n【设备信息：我司可能会根据用户在app软件安装及使用中授予的具体权限，接收并记录用户所使用的设备相关信息（例如：设备型号、操作系统版本、设备设置、唯一设备标识符等软硬件特征信息等）、设备所在位置相关信息（例如：IP地址、GPS位置以及能够提供相关信息的WLAN接入点、蓝牙和基站传感器信息等）】\n3、平台不会主动共享或转让您的个人信息至第三方，如存在其他共享或转让您的个人信息情形时，我们会征得您的明示同意，此外我们会对对外提供信息的行为进行风险评估。\n二、我们如何使用用户信息\n我们将按照法律规定及与用户间的约定，为以下目的使用用户信息：\n1、帮助用户完成注册及登陆，向用户提供商品或服务及尽可能满足用户的个性化需求；\n2、为了更好的检测用户的账户是否存在安全风险，预防网络犯罪，保障用户的合法权益不受侵犯；\n3、因产品开发、升级及管理需要，在合法合理且必要的范围内进行收集及使用说明：\n（1）为了满足用户的个性化服务需求，我司可能要求用户提供特定的个人敏感信息（包括但不限于姓名），若用户拒绝提供的，将可能导致部分功能无法正常使用。\n（2）为了向用户提供优质的服务，我司需获取用户开放相关设备权限，包括但不限于通相机、位置定位、手机存储等，若用户关闭相应权限，将可能导致软件部分或全部功能无法正常使用。\n（3）用户停止使用我司提供的产品或服务的，在符合协议约定及法律法规相关规定的情况下，用户可通过我司对外公布的联系方式申请注销已注册之账号并尽快删除用户的个人信息。\n三、用户如何管理自己的信息\n1、用户可以在使用产品或服务的过程中，可通过特定页面或方式查询、修改和删除所提供的注册信息和其他个人信息。\n2、用户在使用产品或服务过程中，我司将向用户推送、提供用户可能感兴趣的各类通知、广告、公告等内容。若用户不愿意接收相关消息的，可通过手机、软件设置或我司的相关提示以及人工服务，退订或关闭消息推送。\n3、若用户在信息管理过程中存在任何疑问的，可通过我司对外公布的联系方式与我司联系，我司将积极协助用户对自己的信息进行管理。\n四、信息的分享、转让及披露\n1、出于合法、必要、特定的目的，我司将可能因服务提供或履行我司与用户达成的其他协议等需要，向合作伙伴及其他第三方分享用户的信息，以实现我司产品的部分功能。与此同时，我司也将严格要求接触或获取到用户信息的第三方承担保密义务。\n2、根据我司业务开展的实际情况，我司可能进行合并、收购、资产转让或与其他第三方开展类似交易及合作，而用户的信息也可能作为上述交易的一部分进行转移。但我司将严格要求新的主体继续受本政策约束，或者要求新主体与用户重新约定隐私政策相关内容。\n3、我司不会对外公开或向其他与服务提供无关的第三方披露用户信息，但下列情况除外：\n（1）已获得用户的相应授权；\n（2）遵守法律法规的相关规定；\n（3）根据司法机关的相关要求，或者按照生效的判决、裁定等法律文书内容或其他法律程序的规定；\n（4）根据行政机关的要求；\n（5）为维护社会公共利益及国家安全；\n（6）用户已主动向社会公众公开个人信息；\n（7）相关用户信息是从合法公开披露的信息中收集的；\n（8）为保障用户权益、维护我司合法权益及其他合理且必要的目的。\n五、用户信息的存储与保护\n1、我司将采用必要的技术手段对用户的信息进行保护，并建立严格的制度规范限制用户信息的访问权限，尽最大努力防止用户信息遭受未经授权的访问、使用或修改。但基于网络环境的复杂性和技术手段的局限性，我司无法保证用户信息的百分之百安全。\n2、请您在使用我司服务过程中妥善保管您的账号、密码及其他身份信息。服务提供过程中，我司将通过账号、密码及其他身份信息对用户进行身份识别，用户也应对账号下的行为承担全部责任。因此，我司建议用户不定期对个人账号的密码进行修改，若用户发现自身账号、密码或其他身份信息泄漏导致个人账号可能或已经被他人使用时，请及时与我司联系，我司将及时采取相应措施避免用户损失的进一步扩大。\n六、关于Cookies的使用\n1、为保证产品的正常运营，且为用户提供更良好的产品体验并向用户推送感兴趣的内容，我司将可能在用户的计算机或移动设备上储存Cookies小数据文件。\n2、用户可以通过浏览器或相关途径自主选择或管理Cookies。\n七、未成年人保护\n我们非常重视未成年人信息的保护，根据相关法律法规规定，若用户是18周岁以下的未成年人，在使用我司服务前，应事先取得您的家长或法定监护人的同意。任何人发现存在未成年人违反该约定使用我司提供的产品或服务的，可通过我司对外公布的联系方式与我司联系，我司将及时进行处理，以保障未成年人的合法权益。\n八、其他\n为了给用户提供更优质的服务，我司可能会根据产品或服务更新、升级的实际情况及法律法规的相关要求修改本政策的条款，并且可能需要收集、使用新的个人信息或变更个人信息使用目的或方式。届时，我司将通过新隐私政策、弹窗、通知、公告等各种进行提示或说明。若用户不同意变更或修改后的内容的，可以选择停止使用我司提供的产品或服务；如用户在协议变更后仍继续使用我司产品或服务的，即视为用户已充分阅读、理解并同意受变更后政策的约束。\n"),
